import './App.css';
import ReactDOM from 'react-dom'
import React from 'react'
import { render } from "react-dom";

const elements = [];

elements.push({
    tag: "h1",
    attributes: null,
    value: "Webpage Title"
})

const App = () =>
    elements.map(starUser => {
        let Tag = starUser.tag;
        let attributes = starUser.tag;
        let value = starUser.tag;
        return (
        <Tag key={starUser.toString()} {...attributes}>
            {value}
        </Tag>
        );
    });

ReactDOM.render(<App />, document.getElementById("root"));

export default App;
